import React from 'react';

function AboutPage() {

  const text = `栃木県在住の現在バンタンテックフォードアカデミーに在学中の22歳の男です。`

  return (
    <div className='about'>
      <div className='about-title'>
        Career
      </div>
      <div className='about-my-career'>
        {text}
      </div>
    </div>

  )
}

export default AboutPage;
